There is no one answer to this question, as it is a difficult one. Each person's challenges and strengths vary, as do their abilities and willingness to confront themselves about their struggles. However, some general things that all therapists should know are: 
-be patient with patients; 
-mentor and encourage patients; 
-recognize and embrace the power of self-help; 
-remember that patients are human, and that everyone experiences pain in different ways; 
-take advantage of Patients' unique talents; 
-always be supportive and understanding;
